  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains the number of Carbon
  Monoxide deaths in the state of Iowa. Measures include unintentional fire-related
  poisoning, unintentional non-fire related poisoning, and undetermined source poisoning.
  Data are stratified by age group, sex, and county.  This dataset is intended to
  provide data consistent with the guidance for creating carbon monoxide mortality
  Nationally Consistent Data Measures (NCDMs).  The data contained in this dataset
  is collected by the Iowa Department of Public Health Vital Records Program. This
  dataset contains confidential information. Small numbers suppression has been applied
  to data available to the public.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
